import React from 'react';

const CricketBallIcon = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="48"
      height="48"
      viewBox="0 0 24 24"
      fill="none"
      className="cricket-ball-icon"
    >
      {/* Outer circle representing the cricket ball */}
      <circle cx="12" cy="12" r="10" fill="#c62828" stroke="#b71c1c" strokeWidth="2" />

      {/* Main seam with a shiny effect */}
      <path
        d="M4 12c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="2"
        strokeLinecap="round"
        strokeDasharray="2 2"
        strokeOpacity="0.8"
      />

      {/* Additional seams to represent the stitched threads */}
      <path
        d="M4 10c4 4 8 4 12 0M4 14c4 4 8 4 12 0"
        stroke="white"
        strokeWidth="2"
        strokeLinecap="round"
        strokeDasharray="2 2"
        strokeOpacity="0.8"
      />
    </svg>
  );
};

export default CricketBallIcon;
